import react from 'react';
import './App.css';
import BackgroundImage from './BackgroundImage';
import GoogleFontLoader from 'react-google-font-loader';

function App() {
  return (
    <>
      <GoogleFontLoader fonts={[{ font: 'Dancing Script' }]} />
      <div className="app-container">
        <BackgroundImage />
      </div>
    </>
  );
}

export default App;
